import React from 'react';

const Attacks = ({ pokemon }) => (
    <div>
        {pokemon.attacks.map(attack => {
            return <Attacks
                key={attack.name}
                name={attack.name}
                text={attack.text}
                cost={attack.cost} />
        })}
        <h2>Attack: {name}</h2>
        <h3>{text}</h3>
        <h3>Cost: {cost}</h3>
    </div>
);

export default Attacks;
